  \"Ultra-Lightweight Hybrid Structured Mirror Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T06:04:13.472276\",\n\t\"name\": \"ultra-lightweight-hybrid-structured-mirror-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"MMCC is proposing herewith a hybrid structured
  mirror that combines the advantages of SiC membrane and magnesium graphite composite.
  \ The significance of magnesium graphite composite is that it can be produced with
  quasi-isotropic properties and closely matched CTE down to cryogenic temperatures.
  \ In the proposed hybrid mirror, SiC membranes are used as the front and back faces
  of the mirror and an egg crate structure made of magnesium graphite composite is
  sandwiched between the SiC membranes.  The proposed hybrid mirror structure is expected
  to have high specific stiffness, good thermal stability, be light weight, and producable
  at moderate cost. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
